&quot;Thorne is a television drama series which debuted on Sky1 in the UK on October 10, 2010. It stars David Morrissey who plays the title role of Detective Inspector Tom Thorne created by crime writer Mark Billingham. The supporting cast includes Aidan Gillen, Eddie Marsan and Natascha McElhone. The first three episodes were known as thorne: Sleepyhead and the latter three episodes were under the banner thorne: Scaredy Cat.&quot;
